import HeaderAndNavBar from './HeaderAndNavBar';
import {useLocation} from 'react-router-dom';
import './FullAnalysis.css';

function FullAnalysis(props) {
    const location = useLocation()

  return (
    <>
    <HeaderAndNavBar />
    <div id='AI2'>
    {location.state.title} 
        <p>{location.state.content}</p>
        <p>Genre: {location.state.genre}</p>
        <p>{location.state.analysis}</p>
        <p>{location.state.image && <img id='aiImg2' src={location.state.image} />} </p>
        </div>
        </>

  );
}

export default FullAnalysis;
